    false,nt"url": null,nt"notes": "This annual narrative report for Pablo
    National Wildlife Refuge outlines Refuge accomplishments during the 1966 calendar
    year. The report begins by summarizing the weather conditions, water conditions,
    habitat conditions, and food and cover during this period. Wildlife- including migratory
    birds, upland game birds, furbearers, predators, rodents, raptors, fish, and reptiles-
    is also covered. The Refuge development and maintenance section discusses physical
    developments and vegetation control. Resource management is outlined; topics include
    grazing and fur harvest. A progress report on field investigations and applied research
    is also provided. The public relations section of the report describes recreational
    uses, hunting, and violations. N-R forms and photographs are attached.",nt"owner_org":
